import axios from 'axios';
import Ssssss from './componets/team.jsx';

function Form() {

    const [team,setTeam] = useState();

    useEffect(() => {
        document.title = 'ddd';

        async function dataget(){
            const dd = await axios.get('/api/team');
            setTeam(dd.data);
        }
        dataget();
    },[]);

    return (
        <>  
           
        </>
    )
}

export default Form
